import './FileUpload.css';
import axios from 'axios';
import FileUploadIcon from '@mui/icons-material/FileUpload';

function FileUpload() {
  function handleSubmit(e) {
    e.preventDefault();

    axios.post(`/upload`)
      .then(res => {
        console.log(res);
        console.log(res.data);
      })
  }
  return (
    <div className="upload__body">
      <button className="upload__container" onClick={handleSubmit}><FileUploadIcon className="upload_icon"/>Upload</button>
      <div>
        <label className="custom-file-upload">
            <input className="upload__container" type="file" name="name" onChange={handleSubmit}/>
            Upload
        </label>
      </div>
    </div>
  )
}

export default FileUpload;
